import React from "react";
import Navbar from "../components/Navbar";
import { MainPage, CataloguePage } from "../pages";
import {Content} from '../components/Content'

import { Route, Routes } from "react-router-dom";

const App = () => {
    return (
        <div>
            <Navbar/>
            <Routes>
                <Route path="/"
                    element={<MainPage/>}/>
                <Route path="/cat"
                    element={<CataloguePage/>}/>
            </Routes>
        </div>
    )
}

export default App;
